{
  "openapi":"3.0.0",
  "info":{
    "title":"oas3 api",
    "version":"0.0.1"
  },
  "servers":[
    {
      "url":"https:\/\/localhost"
    }
  ],
  "components":{
    "securitySchemes":{
      "bearerAuth":{
        "type":"http",
        "scheme":"bearer"
      }
    }
  },
  "security":[
    {
      "bearerAuth":[

      ]
    }
  ],
  "paths":{
    "\/api\/":{
      "get":{
        "tags":[
          [
            "self"
          ]
        ],
        "summary":null,
        "description":null,
        "parameters":[

        ],
        "responses":{
          "default":{
            "description":"ok"
          }
        }
      }
    },
    "\/api\/subscriptions\/updated-since\/{since}":{
      "get":{
        "tags":[
          [
            "updated-since"
          ]
        ],
        "summary":"Get the subscriptions that were updated since a given date",
        "description":"This endpoint allows you to ask for all the subscriptions that got some new product information since a given date.",
        "parameters":[
          {
            "name":"since",
            "in":"path",
            "required":true,
            "schema":{
              "type":"string"
            }
          },
          {
            "name":"limit",
            "in":"path",
            "required":true,
            "schema":{
              "type":"string"
            }
          }
        ],
        "responses":{
          "default":{
            "description":"ok"
          }
        }
      }
    },
    "\/api\/subscriptions\/{subscription_id}":{
      "delete":{
        "tags":[
          "cancel"
        ],
        "summary":"Cancel a given subscription",
        "description":"This endpoint allows you to cancel a product subscription to stop receiving new product information.",
        "parameters":[
          {
            "name":"subscription_id",
            "in":"path",
            "required":true,
            "schema":{
              "type":"string"
            }
          }
        ],
        "responses":{
          "default":{
            "description":"ok"
          }
        }
      }
    },
    "\/api\/subscriptions":{
      "post":{
        "tags":[
          "subscribe"
        ],
        "summary":"Subscribe to one or several products",
        "description":"This endpoint allows you to create subscriptions on some products. You will then be able to regularly get new product information on these products.",
        "requestBody":{
          "content":{
            "application\/x-www-form-urlencoded":{
              "schema":{
                "type":"object",
                "properties":{
                  "0[upc]":{
                    "type":"string"
                  },
                  "0[asin]":{
                    "type":"string"
                  },
                  "0[mpn_brand]":{
                    "type":"string"
                  },
                  "hub.callback":{
                    "type":"string"
                  },
                  "hub.secret":{
                    "type":"string"
                  }
                }
              }
            },
            "application\/json":{
              "schema":{
                "$ref":"https:\/\/localhost\/docs\/3-api-spec\/request\/subscribe.json"
              }
            }
          }
        },
        "responses":{
          "default":{
            "description":"ok"
          }
        }
      }
    }
  }
}
